DECLARE @AAH_GIS_SEGMENTS TABLE (
	OBJECTID int NOT NULL,
	AAH_SEGMENT_ID int NULL,
	SEGMENT_STATUS nvarchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	FROM_TO_DESC nvarchar(200) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	SEGMENT_LENGTH_MILES numeric(38,8) NULL,
	AAH_ROUTE_NAME nvarchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	DIST_NM nvarchar(20) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	DIST_ABRVN nvarchar(3) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	DIST_NBR int NULL,
	CNTY_NM nvarchar(20) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	CNTY_NBR int NULL,
	MNT_OFFICE_NM nvarchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	MNT_SEC_NBR smallint NULL,
	CREATED_BY nvarchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	CREATED_ON datetime2 NULL,
	UPDATED_BY nvarchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	UPDATED_ON datetime2 NULL,
	SEGMENT_PREFIX nvarchar(3) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	SEGMENT_RTE_NUMBER nvarchar(10) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	SEGMENT_SUFFIX nvarchar(5) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	SEGMENT_ROADBED nvarchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	SEGMENT_BOUNDS nvarchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	SEGMENT_FROM_LAT numeric(38,8) NULL,
	SEGMENT_FROM_LONG numeric(38,8) NULL,
	SEGMENT_TO_LAT numeric(38,8) NULL,
	SEGMENT_TO_LONG numeric(38,8) NULL,
	REF_MARKER_FROM nvarchar(5) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	REF_MARKER_TO nvarchar(5) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	BEGIN_DFO numeric(38,8) NULL,
	END_DFO numeric(38,8) NULL,
	GROUP_NAME nvarchar(1000) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	UNAVAILABLE_REASON_FIELD nvarchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	DEACTIVATED_REASON_FIELD nvarchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	MAINTAINANCE_OFFICER_EMAIL nvarchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	DISTRICT_COORDINATOR_EMAIL nvarchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	DEACTIVATE_OTHER nvarchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	UNAVAILABLE_OTHER nvarchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	TXDOT_ROUTE_NAME nvarchar(17) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	ORGANIZATION_ID int NULL,
	GlobalID uniqueidentifier NOT NULL,
	Shape geometry NULL,
	GDB_GEOMATTR_DATA varbinary(MAX) NULL
);



SELECT 
t1. OBJECTID, t1.AAH_SEGMENT_ID, t1.SEGMENT_STATUS, t1.FROM_TO_DESC, t1.SEGMENT_LENGTH_MILES, t1.AAH_ROUTE_NAME, t1.DIST_NM, t1.DIST_ABRVN, t1.DIST_NBR, t1.CNTY_NM, t1.CNTY_NBR, t1.MNT_OFFICE_NM, t1.MNT_SEC_NBR, t1.CREATED_BY, t1.CREATED_ON, t1.UPDATED_BY, t1.UPDATED_ON, t1.SEGMENT_PREFIX, t1.SEGMENT_RTE_NUMBER, t1.SEGMENT_SUFFIX, t1.SEGMENT_ROADBED, t1.SEGMENT_BOUNDS, t1.SEGMENT_FROM_LAT, t1.SEGMENT_FROM_LONG, t1.SEGMENT_TO_LAT, t1.SEGMENT_TO_LONG, t1.REF_MARKER_FROM, t1.REF_MARKER_TO, t1.BEGIN_DFO, t1.END_DFO, t1.GROUP_NAME, t1.UNAVAILABLE_REASON_FIELD, t1.DEACTIVATED_REASON_FIELD, t1.MAINTAINANCE_OFFICER_EMAIL, t1.DISTRICT_COORDINATOR_EMAIL, t1.DEACTIVATE_OTHER, t1.UNAVAILABLE_OTHER, t1.TXDOT_ROUTE_NAME, t1.ORGANIZATION_ID, t1.GlobalID, t1.Shape, t1.GDB_GEOMATTR_DATA
FROM
@AAH_GIS_SEGMENTS t1
LEFT JOIN gis.AAH_GIS_SEGMENTS t2 ON t1.OBJECTID = t2.OBJECTID
WHERE t2.OBJECTID IS NULL;


