-- update dates
UPDATE APPLICATIONS
SET
      [FIRST_SCHEDULED_PICKUP] = DATEADD(mm, 3, CREATED_ON)
      ,[AGREEMENT_START_DATE] = DATEADD(mm, 2, CREATED_ON)
      ,[AGREEMENT_END_DATE] = DATEADD(yy, 3, CREATED_ON)
	  ,[PICKUPS_START_DATE] = DATEADD(mm, 3, CREATED_ON)
	  ,[PICKUPS_END_DATE] = DATEADD(mm, 20, CREATED_ON)
	  ,[REQUIRED_PICKUPS_PER_YEAR] = 3
WHERE STATUS NOT IN ('Not confirmed', 'Segment assignment needed', 'Sign name denied');

-- insert missing phone numbers for users with emails
SELECT t6.USER_ID, 'Primary', '512-555-1234', 'SAMPLE DATA INSERTED'
FROM ORGANIZATION t4
INNER JOIN ROLE t5 ON t5.ORGANIZATION_ID = t4.ORGANIZATION_ID AND  t5.TYPE = 'District Coordinator'
INNER JOIN USER_PERSON t6 ON t5.USER_ID = t6.USER_ID
LEFT JOIN PHONE t7 ON t6.USER_ID = t7.USER_ID AND t7.TYPE = 'Primary'
WHERE t7.PHONE_ID IS NULL AND t6.USERNAME LIKE '%@%';

SELECT t6.USER_ID, 'Primary', t6.USERNAME, 'SAMPLE DATA INSERTED'
FROM USER_PERSON t6
LEFT JOIN EMAIL t7 ON t6.USER_ID = t7.USER_ID AND t7.TYPE = 'Primary'
WHERE t7.EMAIL_ID IS NULL AND t6.USERNAME LIKE '%@%';

