INNER JOIN gis.AAH_GIS_SEGMENTS t2 on t1.AAH_SEGMENT_ID = t2.AAH_SEGMENT_ID
INNER JOIN DISTRICT t3 ON t2.DIST_NBR = t3.NUMBER
INNER JOIN ORGANIZATION t4 ON t3.ORGANIZATION_ID = t4.ORGANIZATION_ID
INNER JOIN ROLE t5 ON t5.ORGANIZATION_ID = t4.ORGANIZATION_ID AND  t5.TYPE = 'District Coordinator'
INNER JOIN USER_PERSON t6 ON t5.USER_ID = t6.USER_ID
LEFT JOIN PHONE t7 ON t6.USER_ID = t7.USER_ID AND t7.TYPE = 'Primary'
LEFT JOIN EMAIL t8 ON t6.USER_ID = t8.USER_ID AND t8.TYPE = 'Primary';

